-class EscapeReader extends FilterReader {
-    public EscapeReader(Reader in) {
-        super(in);
-    }
-
-    public int read() throws IOException {
-        if (buffer != null) {
-            String b = buffer.toString();
-            int result = b.charAt(0);
-            if (b.length() > 1)
-                buffer = new StringBuffer(b.substring(1));
-            else
-                buffer = null;
-            return result;
-        }
-        else {
-            int result = super.read();
-            if (result != '\\')
-                return result;
-            else {
-                buffer = new StringBuffer();
-                result = super.read();
-                buffer.append((char)result);
-                if (result == 'u') {
-                    for (int i = 0; i < 4; i++) {
-                        result = super.read();
-                        if (result == -1)
-                            break;
-                        buffer.append((char)result);
-                    }
-                    String number = buffer.toString().substring(1);
-                    result = Integer.parseInt(number, 16);
-                    buffer = null;
-                    return result;
-                }
-                return '\\';
-            }
-        }
-    }
-
-    public int read(char[] cbuf, int start, int len) throws IOException {
-        int p = start;
-        int end = start + len;
-        int c = 0;
-        while (c != -1 && p < end) {
-            c = read();
-            if (c != -1)
-                cbuf[p++] = (char)c;
-        }
-        if (c == -1 && p == start)
-            return -1;
-        else
-            return p - start;
-    }
-
-    private StringBuffer buffer = null;
-}
